const cacheName="dashboard-page";async function installEventHandler(){return(await caches.open(cacheName)).addAll(["/"])}self.addEventListener("install",(async e=>{e.waitUntil(installEventHandler())})),self.addEventListener("fetch",(e=>{console.log("url of the req",e.request.url),e.respondWith(caches.match(e.request).then((t=>t||fetch(e.request))))}));